import React from "react";

const Projects = (props) => {
	// console.log(props);
	return (
		<div>
			<div>
				<h1>helllo</h1>
				<p>yes we r here proceed</p>
			</div>
			<div>
				{props.websites.websites.map((site) => {
					return (
						<div key={site.id} className={site.className}>
							<div>
								<img src={site.image} alt="" />
							</div>
							<div>
								<h3>{site.name}</h3>
								<p>{site.description}</p>
								<p>{site.Responsibilities}</p>
								<div>
									<p className={site.languagesDisplayed[0]}>
										{site.languagesDisplayed[0]}
									</p>
									<p className={site.languagesDisplayed[1]}>
										{site.languagesDisplayed[1]}
									</p>
									<p className={site.languagesDisplayed[2]}>
										{site.languagesDisplayed[2]}
									</p>
									<p className={site.languagesDisplayed[3]}>
										{site.languagesDisplayed[3]}
									</p>
									<p className={site.languagesDisplayed[4]}>
										{site.languagesDisplayed[4]}
									</p>
									<p className={site.languagesDisplayed[5]}>
										{site.languagesDisplayed[5]}
									</p>
									<p className={site.languagesDisplayed[6]}>
										{site.languagesDisplayed[6]}
									</p>
								</div>
							</div>
						</div>
					);
				})}
			</div>
		</div>
	);
};

export default Projects;
